# Definition for a binary tree node.
from typing import List, Optional
from iv.Binarytree.mytree import MyTree


class TreeNode:
    def __init__(self, val=0, left=None, right=None):
        self.val = val
        self.left = left
        self.right = right
class Solution:
    def createBinaryTree(self, descriptions: List[List[int]]) -> Optional[TreeNode]:
        roots = {}
        root = []

        # Initializing each node in the tree (All child and parent nodes).
        for [r,c,i] in descriptions:
            if r not in roots:
                roots[r] = TreeNode(r)
            if c not in roots:
                roots[c] = TreeNode(c)

        # Identifying root.
        childs = set([x[1] for x in descriptions])
        for [r, c, i] in descriptions:
            if r in childs:
                continue
            if not root:
                root = r

        # Connecting child and parent.
        for [r,c,i] in descriptions:
            if i:
                roots[r].left = roots[c]
            else:
                roots[r].right = roots[c]

        return roots[root]

    def createBinaryTree2(self, descriptions: List[List[int]]) -> Optional[TreeNode]:
        root = None
        roots = []
        childs = set([x[1] for x in descriptions])

        def traverse(root, i, j, k):
            if not root:
                return
            if root.val == i:
                if k == 1:
                    root.left = TreeNode(j)
                else:
                    root.right = TreeNode(j)
            else:
                traverse(root.left, i, j, k)
                traverse(root.right, i, j, k)

        # find root
        for [r,c,i] in descriptions:
            if r in childs:
                continue
            if not root:
                root = TreeNode(r)
            if i == 1:
                root.left = TreeNode(c)
            else:
                root.right = TreeNode(c)

            roots.append(c)

        while roots:
            for r in roots:
                for [x,y,z] in descriptions:
                    if x == r:
                        roots.append(y)
                        traverse(root, x, y, z)
                roots.remove(r)

        return root


